import React from "react";
import "./App.css";
import { ReduxStore } from "./redux-store";
import {GoogleBtn} from "./home"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ReduxStore />
      </header>
      <div className="g-signin2" data-onsuccess="onSignIn">
        Signin
      </div>
    </div>
  );
}

export default App;
